import React from 'react';
import ReactDOM from 'react-dom/client';
import App, { ShoppingList } from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <ShoppingList />
  </React.StrictMode>
);
